import React from 'react'
// import { Link } from 'react-router-dom';
import * as rb from "react-bootstrap";

class Cse extends React.Component {
    render() { 
        return (
            <rb.Container>
                <rb.Row>
                    <rb.Col>
                        Semester 1
                    </rb.Col>
                    <rb.Col>
                        Semester 2
                    </rb.Col>
                    <rb.Col>
                        Semester 3
                    </rb.Col>
                    <rb.Col>
                        Semester 4
                    </rb.Col>
                </rb.Row>
            </rb.Container>
        );
    }
}

export default Cse;
